import consumer from "./consumer"

consumer.subscriptions.create({ channel: "RoomChannel", room_id: 3 }, {
  connected() {
    console.log("connected...")
  },

  disconnected() {
    // Called when the subscription has been terminated by the server
  },

  received(data) {
    console.log(data)
  }
});
